query ($filters: TeacherSelectionInput) {
  getTeacherSelection(filters: $filters) {
    data {
      attributes {
        id
        user_id
        profile_url
        teacher_alias
        name
        avatar
        description
        experience
        country
        grade
        new_teacher_badge
        super_tutor
        certificate
        active_students
        lessons_complete
        preparation_programs {
          key
          label
          __typename
        }
        __typename
      }
      id
      __typename
    }
    status
    meta {
      paginator {
        total_count
        __typename
      }
      __typename
    }
    __typename
  }
}
